  const hour= showdate.getHours() + ":" + showdate.getMinutes()+ ":" + showdate.getSeconds();
}
return (
    <div>
     <p>{dateToday}</p>
     <h2>{hour}</h2>
    </div>
    );
}
  export default Datetime;
